import React, {useEffect, useState} from "react";
import {Card, Container} from "semantic-ui-react";
import API from "../../api";
import "./style.css";
async function fetchDataCall() {
  try {
    const response = await API.get("/feedbacks");
    return response;
  } catch (error) {
    console.log("error", error);
  }
}

function FeedbackList() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      let data = await fetchDataCall();
      setData(data);
    };
    getData();
    console.log("respones", data);
  }, []);

  let FeedbackListToRender;
  if (data !== [] && data.data !== undefined) {
    FeedbackListToRender = data.data.data.map((feedback) => (
      <Card
        fluid
        header={feedback.attributes.body}
        description={
          "User: " +
          feedback.attributes.user.firstname +
          " " +
          feedback.attributes.user.lastname +
          "Email: " +
          feedback.attributes.user.email
        }
      />
    ));
  }

  return (
    <Container className='main-container'>
      <Card.Group>{FeedbackListToRender}</Card.Group>
    </Container>
  );
}

export default FeedbackList;
